import { connect } from 'react-redux';

import {  changeMessage } from './../../actions';


const mapDispatchToProps = {
    changeMessage,
   };


const instantEffects = props =>  {
    this.Factory = () => {
        //When constructed, select 1 of 5 resources. This resource becomes the wild.
        //get all non wild resources

        //select one resourse

        //change selected to "wild"
        console.log("Fact");

        props.changeMessage('Factory') ;

    }

};



export default connect(null, mapDispatchToProps) (instantEffects);
